import React, {lazy, Suspense, useContext, useEffect} from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import refreshAlert from "./utils/refreshAlert";

const Login = lazy(() => import('./pages/login'));
const Home = lazy(() => import('./pages/home'));
const Edit = lazy(() => import('./pages/./edit'));
const Published = lazy(() => import('./pages/published'));
const Draft = lazy(() => import('./pages/draft'));
const Involved = lazy(() => import('./pages/involved'));
const Profile = lazy(() => import('./pages/profile'));
const Setting = lazy(() => import('./pages/setting'));

const App = () => {

	useEffect(() => {
		// 刷新警告
		document.addEventListener('keydown', refreshAlert);

		return () => {
			document.removeEventListener('keydown', refreshAlert);
		}
	}, [])

	return (
		<div>
			<Router>
				<Suspense fallback={<div>loading...</div>}>
					<Routes>
						<Route element={<Login/>}>
							<Route path='/' element={<Home/>}>
								<Route index element={<Published/>}/>
								<Route path='published' element={<Published/>}/>
								<Route path='edit' element={<Edit/>}/>
								<Route path='draft' element={<Draft/>}/>
								<Route path='involved' element={<Involved/>}/>
								<Route path='profile' element={<Profile/>}/>
								<Route path='setting' element={<Setting/>}/>
							</Route>
						</Route>
					</Routes>
				</Suspense>
			</Router>
		</div>
	);
};

export default App;
